function GetIframe(fctIfmId, fctVisibility, fctTop, fctLeft, fctWidth,
		fctHeight) {
	var frmCity = getObjById(fctIfmId);
	if (!frmCity) {
		frmCity = document.createElement("iframe");
		frmCity.id = fctIfmId;
		frmCity.style.position = "absolute";
		frmCity.style.zIndex = "1";
		frmCity.style.visibility = "hidden";
		document.body.appendChild(frmCity);
	}
	if (fctTop)
		frmCity.style.top = fctTop + "px";
	if (fctLeft)
		frmCity.style.left = fctLeft + "px";
	if (fctWidth)
		frmCity.style.width = fctWidth + "px";
	if (fctHeight)
		frmCity.style.height = fctHeight + "px";
	if (fctVisibility)
		frmCity.style.visibility = (document.all ? fctVisibility : "hidden	");
	return frmCity;
}

