function GetCityList(fctThisObj) {
	var varMenuObj = creatObj("divAddressMenu");
	var varThisObj = fctThisObj;
	if (varThisObj.id == "menuPageS" || varThisObj.id == "menuPageE") {
		varThisObj = varMenuObj.obj;
	} else {
		PageId = 0;
	}

	if (document.getElementById("CityList") != null && document.getElementById("CityList").value != "")
		varAddressList = document.getElementById("CityList").value;
	var varThisObjAutoInput = GetValueToInputObj(varThisObj);
	if (varThisObjAutoInput)
		varThisObjAutoInput.value = "";

	var varObjValue = varThisObj.value;
	var varThisObjAdd = (varThisObj.getAttributeNode("mod_address_suggest") ? varThisObj .getAttributeNode("mod_address_suggest").value : "");
	var varData = (varObjValue == "" ? (varThisObjAdd == "" ? varAddressList : varThisObjAdd) : varAddressList);
	var varHtmlStr = "", varCityDataSplit = varData.split("@"), varCityDataSplitI, varCityDataSplitIu, varNextPageStr = "";

	varMenuObj.obj = varThisObj;
	var varPageRCount = (varThisObj.getAttributeNode("pagecount") ? parseInt(varThisObj.getAttributeNode("pagecount").value, 10) : 10);

	var varThisPageI = 0
	for (var i = 1; i < varCityDataSplit.length - 1; i++) {
		varCityDataSplitI = varCityDataSplit[i];

		varCityDataSplitISplit = varCityDataSplitI.split("|");

		if (varCityDataSplitI.toUpperCase().indexOf(varObjValue.toUpperCase()) == 0
				|| varCityDataSplitISplit[2].toUpperCase().indexOf(varObjValue.toUpperCase()) == 0
				|| varCityDataSplitISplit[1].toUpperCase().indexOf(varObjValue.toUpperCase()) >= 0
				|| varObjValue == ""
				|| i == varObjValue) { // || varCityDataSplitI.toLowerCase().indexOf(varObjValue.toLowerCase())>=0

			varThisPageI += 1;
			if (varThisPageI > PageId * varPageRCount && varThisPageI <= (PageId + 1) * varPageRCount) {
				// varCityDataSplitISplit=varCityDataSplitI.split("|");
				varHtmlStr += "<a href='javascript:;' onclick='GetCity("+ varThisPageI + ",\""+varCityDataSplitI+"\")' id='menuA" + varThisPageI;
				varHtmlStr += "' title=''><span>";
				varHtmlStr += varCityDataSplitISplit[0] + "&nbsp;&nbsp;</span>";
				varHtmlStr += varCityDataSplitISplit[1] + "</a>";// ("+varCityDataSplitISplit[2]+")
			}
		}
	}

	PageNum = parseInt(varThisPageI / varPageRCount) + 1;

	if (varThisPageI > varPageRCount) {
		varNextPageStr = "&nbsp;<span id=menuPageS style="
		varNextPageStr	 += (PageId > 0 ? "cursor:pointer;" : "color:#ccc;");
		varNextPageStr	 += "font-family:Verdana>&lt;&lt;&nbsp;上一页</span><span style='margin:0 8px 0 8px'>";
		varNextPageStr	 += (PageId + 1) + "/" + PageNum + "</span>";
		varNextPageStr += "<span id=menuPageE style=";
		varNextPageStr += (varThisPageI > (PageId + 1) * varPageRCount ? "cursor:pointer;": "color:#ccc;");
		varNextPageStr += "font-family:Verdana>下一页&nbsp;&gt;&gt;</span>";
	}
	var varThisObjPosition = getPosition(varThisObj);
	with (varMenuObj) {
		style.top = varThisObjPosition.top + varThisObjPosition.height + "px";
		style.left = varThisObjPosition.left + "px";
		style.visibility = "visible";
		innerHTML = "<div><h4 style='font-family:vernada'>输入拼音/中文或→←↑↓选择</h4>";
		innerHTML +=	 (varHtmlStr == "" ? "<nobr>搜索不到匹配信息：<font color='red'>‘" + varObjValue+ "’</font></nobr>" : varHtmlStr + varNextPageStr);
		innerHTML += "</div>";
	}

	return false;
}

function creatObj(fctId, fctClassName) {
	var varTempDivObj = getObjById(fctId);
	if (!varTempDivObj) {
		varTempDivObj = document.createElement("div");
		varTempDivObj.id = fctId;
		if (fctClassName && fctClassName != "")
			varTempDivObj.className = fctClassName;
		document.body.appendChild(varTempDivObj);
	}
	return varTempDivObj;
}

function GetValueToInputObj(fctThisObj) {
	if (!fctThisObj)
		return null;
	var varThisObjAutoInput = (fctThisObj.getAttributeNode("value_to_input") ? fctThisObj.getAttributeNode("value_to_input").value: "");
	if (varThisObjAutoInput == "")
		return null;
	return getObjById(varThisObjAutoInput);
}

function GetCity(fctI,varMenuValue) {
	var varMenuObj = creatObj("divAddressMenu");
	var varThisObj = varMenuObj.obj;
	//var varMenuValue = getObjById("menuA" + fctI).title;
	varMenuValue = varMenuValue.split("|");
	varThisObj.value = varMenuValue[1];
}

function getPosition(obj) {
	var top = 0;
	var left = 0;
	var width = obj.offsetWidth;
	var height = obj.offsetHeight;
	while (obj.offsetParent) {
		top += obj.offsetTop;
		left += obj.offsetLeft;
		obj = obj.offsetParent;
	}
	return {
		"top" : top,
		"left" : left,
		"width" : width,
		"height" : height
	};
}

