var index = -1;
var lstCity;
function selCity(e,inputObj) {
	lstCity = getObjById("divAddressMenu");
	
	if ($.trim(getObjById(inputObj).value) == "") {
		lstCity.style.visibility = "hidden";
		return;
	}
	var event = e || window.event;
	var keyCode = event.charCode || event.keyCode;
	if (keyCode != 13 && (keyCode < 37 || keyCode > 40)) {
		GetCityList(getObjById(inputObj));
		stopBubble(e);
		return;
	}
	
	var lks = lstCity.getElementsByTagName('a'); // 选中的城市在列表中序号
	if (keyCode == 13) {
		if (index < 0)
			index = 0;
		lks[index].onclick();
		if (lstCity.style.visibility != "hidden")
			stopBubble(e); // 选择城市
		lstCity.style.visibility = "hidden"; // GetIframe("ifm"+creatObj("divAddressMenu").id,"hidden");
	} else if (keyCode == 38) { // 向上 ||keyCode==37
		index--;
		if (index < 0)
			index = lks.length - 1;
	} else if (keyCode == 40) { // 向下keyCode==39||
		index++;
		if (index >= lks.length)
			index = 0;
	} else if (keyCode == 37) {
		PageId--;
		if (PageId < 0)
			PageId = PageNum - 1;
		GetCityList(getObjById('menuPageS'));
		index = -1;
		return;
	} else if (keyCode == 39) {
		PageId++;
		if (PageId >= PageNum)
			PageId = 0;
		GetCityList(getObjById('menuPageS'));
		index = -1;
		return;
	}
	setCityListStyle(index, lks);
}

function setCityListStyle(index, lks) {
	for (var i = 0; i < lks.length; i++) {
		lks[i].className = '';
		lks[i].style.color = '#008e91';
	}
	lks[index].className = 'sel';
	lks[index].style.color = 'red';
}

function stopBubble(e) // 取消事件上冒
{
	if (!document.all)/* 非IE */
	{
		e.stopPropagation();/* 标准W3C的取消冒泡 */
		e.preventDefault(); /* 取消默认行为 */
	} else {
		event.cancelBubble = true; /* IE的取消冒泡方式 */
		event.returnValue = false; /* IE的取消默认行为，如<a>的转向地址，类似于return false */
	}
}

function getObjById(fctId) {
	return document.getElementById(fctId);
}

// 输入关键字onblur事件默认选择第一个
function DefaultselCity() {
	lstCity = getObjById("divAddressMenu");
	if (index != 0 && PageNum > 1)
		return; // 不输入关键字则不执行默认选择

	var lks = lstCity.getElementsByTagName('a'); // 选中的城市在列表中序号

	if (lks.length == 0)
		return; // 输入没有匹配的关键字则返回

	if (index < 0)
		index = 0;
	lks[index].onclick();
	if (lstCity.style.visibility != "hidden")
		stopBubble(e); // 选择城市
	lstCity.style.visibility = "hidden"; // GetIframe("ifm"+creatObj("divAddressMenu").id,"hidden");

	setCityListStyle(index, lks);
}

function AutoNextInputAct(fctThisObj, fctAct) {
	var varNextInput = fctThisObj.getAttributeNode("nextinput");
	if (varNextInput && varNextInput != "") {
		if (document.all) {
			eval("getObjById('" + varNextInput.value + "')." + fctAct + "()");
		} else {
			var evt = document.createEvent("MouseEvents");
			evt.initEvent(fctAct, true, true);
			getObjById(varNextInput.value).dispatchEvent(evt);
		}
		getObjById(varNextInput.value).focus();
	}
}